import { useState } from "react";
import {useAuthStatusContext, useSetAuthStatusContext} from "./components/AuthContext";
import GoogleAuthSignIn from "./components/GoogleAuthSignIn";

function App() {
  const authStatus = useAuthStatusContext()
  console.log(authStatus)
  return (
    <div className="App">
      {authStatus? (
        <h1>User Logged In</h1>
      ): (
        <GoogleAuthSignIn />
      )}
    </div>
  );
}

export default App;
